import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 63.2-1239 Return of copies furnished to counsel.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1239.md","filePath":"vacode/63.2-1239.md"}'),a={name:"vacode/63.2-1239.md"},i=o('<h1 id="§-63-2-1239-return-of-copies-furnished-to-counsel" tabindex="-1">§ 63.2-1239 Return of copies furnished to counsel. <a class="header-anchor" href="#§-63-2-1239-return-of-copies-furnished-to-counsel" aria-label="Permalink to &quot;§ 63.2-1239 Return of copies furnished to counsel.&quot;">​</a></h1><p>Any copy of the report required by § <a href="http://law.lis.virginia.gov/vacode/63.2-1208/" target="_blank" rel="noreferrer">63.2-1208</a> to be furnished to counsel of record representing the adopting parent or parents shall, upon the entry of a final order of adoption, or other final disposition of the matter, be returned by such counsel, without having been duplicated, to the clerk of the circuit court in which final disposition of the matter is had, to be disposed of as is required by § <a href="http://law.lis.virginia.gov/vacode/63.2-1246/" target="_blank" rel="noreferrer">63.2-1246</a> for the return of the original report.</p><p>Code 1950, § 63-350; 1968, c. 578, § 63.1-224; 1974, c. 26; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.46; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),n=[i];function s(c,l,f,d,h,p){return r(),t("div",null,n)}const g=e(a,[["render",s]]);export{_ as __pageData,g as default};
